import React from "react";
import "./App.css";
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from "react-router-dom";

import Home from "./components/home.js";
import AdminSignIn from "./components/adminlogin.js";
import UserSignIn from "./components/userlogin.js";
import AdminSignUp from "./components/adminregistration";
import UserSignUp from "./components/userregistration";
import AdminDashboard from "./components/admindashboard/admindashboard";
import UserDashboard from "./components/userdashboard";
import Main from "./components/admindashboard/main";
import CreatePolicy from "./components/admindashboard/createPolicy";
import UpdatePolicy from "./components/admindashboard/updatePolicy";
import PrivatePolicies from "./components/admindashboard/privacyPolicies";
import AccessRequests from "./components/admindashboard/accessRequests";
import Users from "./components/admindashboard/users";
import UpdateUser from "./components/admindashboard/updateuser";
import LimitsConstraints from "./components/admindashboard/limitsConstraints";
import GrantPermissions from "./components/admindashboard/grantPermissions";

function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route exact path="/home" component={Home} />
          <Route exact path="/adminlogin" component={AdminSignIn} />
          <Route exact path="/userlogin" component={UserSignIn} />
          <Route exact path="/adminregistration" component={AdminSignUp} />
          <Route exact path="/userregistration" component={UserSignUp} />
          <Route exact path="/admindashboard" component={AdminDashboard} />
          <Route exact path="/userdashboard" component={UserDashboard} />
          <Route exact path="/main" component={Main} />
          <Route
            exact
            path="/pricatepolicies/createpolicy"
            component={CreatePolicy}
          />
          <Route
            exact
            path="/admindashboard/pricatepolicies/updatepolicy"
            component={UpdatePolicy}
          />
          <Route
            exact
            path="/admindashboard/privpol"
            component={PrivatePolicies}
          />
          <Route
            exact
            path="/admindashboard/reqacc"
            component={AccessRequests}
          />
          <Route exact path="/users" component={Users} />
          <Route
            exact
            path="/admindashboard/users/updateuser"
            component={UpdateUser}
          />
          <Route
            exact
            path="/admindashboard/notifications"
            component={Notification}
          />
          <Route
            exact
            path="/admindashboard/limcons"
            component={LimitsConstraints}
          />
          <Route
            exact
            path="/admindashboard/grantperm"
            component={GrantPermissions}
          />

          <Redirect to="/404" />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
